import React, { Component } from 'react';
import "../css/lab.css";
class Lab extends Component {
    state = { 
        name : "Lab Name",
        details : "Mr. Jhon Doe", 
        status : "Pending", 
        icon : ""
    }
    render() { 
        return (
            <div className="container">
                <div className="text">
                    <p className="labname">
                        {this.state.name}
                    </p>
                    <p className="labdetails">
                        {this.state.details}
                    </p>
                </div>
            </div>
        );
    }
}

export default Lab;
